import React from 'react';
import PropTypes from 'prop-types';
import FormItem from '../../../../shared/Form/FormItem/FormItem';
import Input from '../../../../shared/Input/Input';
import Button from '../../../../shared/Button/Button';
import { ROUTES } from '../../../../../config/constants';
import { Link } from 'react-router-dom';

const EnterTelegramId = props => {
    return (
        <div className='bg-white p-7 rounded-md'>
            <h2 className='mb-7 text-2xl font-medium text-gray-800'>Enter Telegram ID</h2>
            <p className='text-gray-700 text-xl mb-5'>Please enter your Telegram ID below</p>
            <FormItem helpMessage label={'Telegram ID'} className={'mb-8'}>
                <Input type={'text'} />
            </FormItem>

            <div className='flex justify-center'>
                <Link to={ROUTES.copyTelegramID.path}>
                    <Button type={'link'} className={'mr-10'}>
                        Previous
                    </Button>
                </Link>
                <Link to={ROUTES.connectNotification.path}>
                    <Button type={'link'}>Connect</Button>
                </Link>
            </div>
        </div>
    );
};

EnterTelegramId.propTypes = {};

export default EnterTelegramId;
